import React, { useEffect } from "react";
import { useDispatch } from "react-redux";

import { getAllnewssThunk} from "../Data/newsThunk";


import Header from "./Header";

import NewssList from "./NewssList"


const Main = () => {


  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getAllnewssThunk({ limit: 6}));
  }, []);

  return (
    <div className="mainPage">
      <Header />

      <div className="newsList">
        <NewssList />
      </div>

    </div>
  );
};

export default Main;
